import dynamic from "next/dynamic";

// const ContentWithImg = dynamic(()=>import("../components/withImg"),{ loading: () => <p>Loading...</p>});


const page1 = () => (
  <>
  <p>Hey routing to page1</p>
  <ContentWithImg/>
  </>
)


page1.getInitialProps = async ({ query }) => {
  const moment = (await import('../components/withImg')).default()

  return {
    date: moment.format('dddd D MMMM YYYY'),
    post: data[query.dynamic]
  }
}

export default page1;
